      background-color: @accent-color;
    }
    .ia-module--stocks.increase .color-coded {
      color: @green !important;
    }
    .stocks-module__hover-label {
      &[style*="color: rgb(222, 88, 51);"] {
        color: @red !important;
      }
      &[style*="color: rgb(91, 158, 77);"] {
